This is the first application designed for the work of corrections, artillerymen, scouts, topogeodes.
A simple and easy interface allows you to perform a large number of tasks in a very short time.

MAP
Direct the tactical setting with the help of:
- creation of layers (overlays) on the map;
- creation of objects on the NATO APP6 Map;

Look for all you need with the help of:
- search for the name of the populated punch (without an internet);
- coordinates search (SK-42, WGS84, MGRS);

Focus on the terrain with the help of:
- display of the coordinates of the map center;
- compass display (60-00 and 360);

METEO
- obtaining meteades using the Internet;
- preservation of the calculated amendments;

TASKS
- calculation of topographic data for purpose;

TOPOGEODESY
Calculate the coordinates with:
- direct geodetic problem;
- reverse geodetic problem;
- surviving observation;

Orient the bead with the help of:
